import React from 'react';
import { useLocation } from 'react-router-dom';

export default function CustomerDetails({ customer }) {
  return (
    <div>
      <p>{customer.name}</p>
      <p>{customer.id}</p>
      <p>{customer.address}</p>
      <p>{customer.phoneNumber}</p>
      <p>{customer.plateNumber}</p>
    </div>
  );
}
